import React from 'react';

function Header (props) {
    return(
    <div>
    <h1 className = "header">Scotty Designs</h1>
        <button onClick = {
            () => {
          return props.onClick();
        }}>
        {(() =>{
            switch(props.buttonText){
                case true: return "Posts";
                case false: return "Home Page";
            }}
        )()}
        </button>


    </div>)
};
export default Header;
